import {FC} from "react";
import {ViewPropsType} from "../@types/AutocompleteControl";
import CountriesModel from "../models/domian/CountriesModel";
import {observer} from "mobx-react";

const AutocompleteControl: FC<ViewPropsType> = observer((props) => {


  return (
    <form>

      <input type="text"
             onChange={props.getSearchCountriesAsync}
             value={props.value}
      />
      <ul>
        {
          props.foundCountries?.
          slice(0,props.maxLengthSelect).
          map((el, ind) => {
            return (
              <li key={ind}>
                <p>
                  <span>{el.name}</span>
                  <span>{el.fullName}</span>
                  <span>{el.flag}</span>
                </p>
              </li>
            )
          })
        }
      </ul>

    </form>
  )
})

export default AutocompleteControl
